import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import data from '../../stories.json';

const StoryThumbnailLink = () => {
    const [stories, setStory] = useState(data)
    console.log(stories)
    console.log('hi')
    return (

        <Link to="/stories">
            <div className="story__thumbnail">
                <img className="story__thumbnail__backdrop" src={stories.illustration} />
                <div className="story__thumbnail__textbox">
                    <h6 className="story__thumbnail__textbox--title"></h6>
                    <small className="story__thumbnail__textbox--author">by </small>
                </div>
            </div>
        </Link>

    )
}

export default StoryThumbnailLink
